	            <div class="blogEditorTextContent">
	               	<p><br></p><p>“Try to leave the Earth a better place than when you arrived" ~ <span><b>Sidney Sheldon</b></span></p><p><img src="data:image/jpeg;base64," data-filename="Blog_1600px-X-900px_06.jpg" class="note-float-right" style="font-size: 0.875rem; width: 100%; float: right;"><span>As rightly said in the quote, we might not be able to change the whole world at a time, but we can definitely try and bring in change at a personal level. Green living is one of the ways of doing so. </span></p><p style="text-align: left;"><br></p><p style="text-align: left;"><b>What exactly is meant by green living?</b><br></p><p style="text-align: left;">It refers to a way of life where your every action and decision is in harmony with nature. Every small step taken in the direction of bringing a change is very crucial - that includes small-scale developments like planting a home garden to a big scale unanimous move of societal tree planting. </p><p style="text-align: left;"><b><br></b></p><p style="text-align: left;"><b>How can we as individuals turn to a greener life?</b><br></p><p style="text-align: left;">Getting into the technicalities of how our carbon footprints are increasing by the day or by what percent are our acts affecting the planet, really is just a means of being informed. Now is the time to act! We have been told multiple times about all the activities we should avoid in order to bring a change, and now is the time to imply them. </p><p style="text-align: justify; "><img src="data:image/jpeg;base64," style="width: 100%;" data-filename="Blog_1600px-X-900px_02.html"><span><br></span></p><p><span>Below mentioned are a few ways in which we can move toward a greener life:</span><br></p><p><span><br></span></p><p style="text-align: left;">1. <b>Set up your home-grown garden</b>: In urban life, due to space crunch, it is next to impossible to have your own extensive garden where you can grow your own plants. But with real estate moving towards sustainable living, developers are now offering garden spaces in your homes where planting of your choice can be done with convenience with space-saving techniques like vertical gardens that utilize the vertical walls of the balconies.</p><p style="text-align: left;"><img src="data:image/jpeg;base64," style="width: 758.463px;" data-filename="Blog_1600px-X-900px_09.html"><br></p><p style="text-align: left;">2. <b>Introduce composting at home</b>: Composting is a way of reducing the wet waste at home and using it as manure for your plants. This practice reduces the amount of waste generated and makes new plants healthier.</p><p style="text-align: justify; "><br></p><p style="text-align: justify; "><span>3. </span><b>Buy sustainably</b><span>: Another way of bringing about a change is by making the right choice as consumers. Buying local produce instead of imported is a way of becoming energy efficient. </span><br></p><p style="text-align: justify; "><br></p><p style="text-align: justify; ">4. <b>Reduce the consumption of single-use plastic</b>: Eliminating plastic altogether is a far-sighted dream but every step towards avoiding the use of plastic can help reduce plastic waste by a significant amount. Some simple ways of doing so are by switching plastic cutlery to wooden ones, and plastic bags to sustainable cloth ones. </p><p style="text-align: justify; "><br></p><p style="text-align: justify; ">5. <b>Change your ways of commuting</b>: Maximum increase in carbon footprints comes from the vehicular exhaust. One way we can curb it on an individual level is by either choosing to travel by public transport or opting for carpooling with people in your locality, traveling to a common location. </p><p><img src="data:image/jpeg;base64," style="width: 100%;" data-filename="Blog_1600px-X-900px_05.html"><br></p><p><b>Are residences moving towards green living?</b><br></p><p style="text-align: left;"><br></p><p style="text-align: left;">As a society, it becomes our duty to give back to mother Earth at least some part of what we consume. Now, be it in the form of waste management, replanting trees, or turning to a renewable source of energy consumption.</p><p style="text-align: left;"><span><br></span></p><p style="text-align: left;"><span>Chandak Group has been taking initiatives to be on the greener side of the development curve. Last year during the festival of Ganesh Chaturthi, a move was made towards </span><b>#GoGreenWithChandak</b><span>, encouraging all our residents to shift towards eco-friendly celebrations. </span><br></p><p style="text-align: left;"><br></p><p style="text-align: left;">To move ahead, a drive for tree plantation was organized at Chandak Stella where every Stella resident planted saplings with their loved ones which would be nurtured to grow into their beloved tree someday</p><p style="text-align: left;"><span><br></span></p><p style="text-align: left;"><span>Apart from the drives, the value for green living is deeply imbibed at Chandak Group. Projects like 34 Park Estate - Goregaon, Unicorn - Andheri (W), Cornerstone - Worli, all are  IGBC (Indian Green Building Council) certified.</span><br></p><p style="text-align: left;"><span><br></span></p><p style="text-align: left;"><span>With the upcoming project GreenAiry, at Magathane, Borivali (E) the company will aim to deliver an opportunity where the best of both worlds come together with open green spaces and airy views at their best. In close vicinity to the Sanjay Gandhi National Park, green living will come naturally as an experience to the residents here.</span><br></p><p style="text-align: left;"><span><br></span></p><p style="text-align: left;"><span>With every single step, we move towards a greener tomorrow and a sustainable and happier life for our loved ones! </span></p><p style="text-align: left;"><span><br></span></p><p style="text-align: left;"><span>Stay Green! Stay Clean!</span></p>	            </div>
